import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Pagination, Mousewheel, Keyboard, Autoplay } from "swiper";
import "swiper/css/bundle";
import StoreSections from "../common/StoreSections";
import "./store_usercomments.css";

const index = () => {
  return (
    <div className="store__container">
      <StoreSections title="O que dizem sobre nós" subtitle="Depoimentos" />
      <div style={{ minHeight: "20vh" }}>
        <Swiper
          className="mySwiper"
          spaceBetween={0}
          slidesPerView={1}
          centeredSlides={true}
          cssMode={true}
          //  autoplay={{
          //    delay: 4500,
          //    disableOnInteraction: false,
          //  }}
          loop={true}
          loopFillGroupWithBlank={true}
          pagination={{
            clickable: true,
          }}
          //  navigation={true}
          mousewheel={true}
          keyboard={true}
          modules={[Pagination, Mousewheel, Keyboard, Autoplay]}
        >
          <SwiperSlide>
            “Awesome theme! Very flexible theme for any needs. Customer support
            are very helpful if you need any help. 10/10”
          </SwiperSlide>
          <SwiperSlide>Slide 2</SwiperSlide>
          <SwiperSlide>Slide 3</SwiperSlide>
        </Swiper>
      </div>
    </div>
  );
};

export default index;
